import React from "react";
import css from "./style.module.css";

import Toolbar from "../../components/ToolBar";
import BurgerPage from "../BurgerPage";
import SideBar from "../../components/SideBar";

function App() {
  return (
    <div>
      <Toolbar />
      <SideBar />
      <main className={css.Content}>
        <BurgerPage />
      </main>
    </div>
  );
}

export default App;
